void smearfile::set_lep(const lep base, const panda::Lepton& lep) {
  switch(base) {
  case smearfile::lep::lep1:
    lep1_pt = lep.pt();
    lep1_eta = lep.eta();
    lep1_phi = lep.phi();
    lep1_m = lep.m();
    break;
  case smearfile::lep::lep2:
    lep2_pt = lep.pt();
    lep2_eta = lep.eta();
    lep2_phi = lep.phi();
    lep2_m = lep.m();
    break;
  default:
    throw;
  }
}

